import React from 'react'
import './Navbar.css'

const Navbar = () => {

    function reloadPage() {
        window.location.reload();
    }

  return (
    <div className='nav'>
        <div className="nav-logo" onClick={reloadPage}>G | K</div>
        <div><p className='list'>Document Management</p></div>

    </div>
  )
}

export default Navbar
